import React from "react";
import { Box, Typography } from "@mui/material";
import DeleteSharpIcon from "@mui/icons-material/DeleteSharp";

const Users = () => {
  return (
    <Box>
      <Typography variant="h3" style={{ padding: "20px" }} display="flex">
        {" "}
        User Data :-{" "}
      </Typography>
      <Box
        bgcolor="#36454F"
        padding="20px"
        borderRadius={5}
        display="flex"
        alignItems="center"
        flexWrap="wrap"
        paddingTop="20px"
      >
        <Box flexGrow={1}>
          <Typography
            color="white"
            fontWeight="bold"
            paddingBottom="10px"
            //style={strikeThrough}
          >
            User 1
          </Typography>
        </Box>

        <Box marginLeft="auto">
          <DeleteSharpIcon style={{ color: "white" }} />
        </Box>
      </Box>
    </Box>
  );
};

export default Users;
